import React, { Component } from 'react'
import './App.css';
import { Link } from 'react-router-dom';
import router from './router'




export default class App extends Component {
  render() {
    return (

      <div className='container'>
        <div>
          <Link to='/'>Home</Link>

        </div>


        <br />
        {router}

      </div>
    )
  }
}
